import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<div class="container ml-4 mt-3 pb-3">
  <ul class="nav nav-pills">
    <li><a class="header-nav-li-a" routerLinkActive='active' routerLink="/">Home</a></li>
    <li><a class="header-nav-li-a" routerLinkActive='active' routerLink="/quizzes">Quizzes</a></li>
    <li><a class="header-nav-li-a" routerLinkActive='active' routerLink="/quizzes/create">Create Quiz</a></li>

    <li><a class="header-nav-li-a" routerLinkActive='active' routerLink="/login">Login</a></li>
    <li><a class="header-nav-li-a" routerLinkActive='active' routerLink="/logout">Logout</a></li>
    <li><a class="header-nav-li-a" routerLinkActive='active' routerLink="/register">Register</a></li>
  </ul>
</div>
